import { Order_Options } from "../comps/Portal";

const Order = () => {
  return (
    <div className="flex">
      <section className="w-2/3 max-md:hidden h-screen fixed"></section>
      <section className="md:w-1/3">
        <Order_Options />
      </section>
    </div>
  );
};

export default Order;
